//  Jigsaw path builder 
const TAB_PTS = [0,0,35,15,37,5,37,5,40,0,38,-5,38,-5,20,-20,50,-20,50,-20,80,-20,62,-5,62,-5,60,0,63,5,63,5,65,15,100,0]

function buildTabPattern(cols: number, rows: number): number[][] {
  const p: number[][] = []
  for (let y = 0; y < rows; y++)
    for (let x = 0; x < cols; x++) {
      const top    = y === 0      ? 0 : -p[(y-1)*cols+x][2]
      const left   = x === 0      ? 0 : -p[y*cols+(x-1)][1]
      const right  = x === cols-1 ? 0 : (Math.random() > .5 ? 1 : -1)
      const bottom = y === rows-1 ? 0 : (Math.random() > .5 ? 1 : -1)
      p.push([top, right, bottom, left])
    }
  return p
}

function buildPath(gx: number, gy: number, cols: number, rows: number, pat: number[][], tw: number): string {
  const sc = tw / 100
  const [top, right, bottom, left] = pat[gy * cols + gx]
  const T = TAB_PTS
  let d = 'M 0 0 '

  // top
  if (gy > 0 && top !== 0) {
    for (let i = 0; i < T.length - 2; i += 6)
      d += `C ${T[i]*sc} ${top*T[i+1]*sc} ${T[i+2]*sc} ${top*T[i+3]*sc} ${T[i+4]*sc} ${top*T[i+5]*sc} `
  } else d += `L ${tw} 0 `

  // right
  if (gx < cols-1 && right !== 0) {
    for (let i = 0; i < T.length - 2; i += 6)
      d += `C ${tw-right*T[i+1]*sc} ${T[i]*sc} ${tw-right*T[i+3]*sc} ${T[i+2]*sc} ${tw-right*T[i+5]*sc} ${T[i+4]*sc} `
  } else d += `L ${tw} ${tw} `

  // bottom (reversed)
  if (gy < rows-1 && bottom !== 0) {
    for (let i = 0; i < T.length - 2; i += 6)
      d += `C ${tw-T[i]*sc} ${tw-bottom*T[i+1]*sc} ${tw-T[i+2]*sc} ${tw-bottom*T[i+3]*sc} ${tw-T[i+4]*sc} ${tw-bottom*T[i+5]*sc} `
  } else d += `L 0 ${tw} `

  // left (reversed)
  if (gx > 0 && left !== 0) {
    for (let i = 0; i < T.length - 2; i += 6)
      d += `C ${left*T[i+1]*sc} ${tw-T[i]*sc} ${left*T[i+3]*sc} ${tw-T[i+2]*sc} ${left*T[i+5]*sc} ${tw-T[i+4]*sc} `
  } else d += 'L 0 0 '

  return d + 'Z'
}

//  Game canvas 
function JigsawCanvas({ image, cols, rows, woodSrc, onComplete, actionsRef }: {
  image: HTMLImageElement, cols: number, rows: number, woodSrc: string,
  onComplete: () => void,
  actionsRef: React.MutableRefObject<{ scatter: ()=>void, fit: ()=>void, zoom: (f:number)=>void } | null>
}) {
  const divRef = useRef<HTMLDivElement>(null)

  useEffect(() => {
    const container = divRef.current
    if (!container) return
    let stageInstance: any = null  // set once Konva initialises

    //  Load Konva from CDN 
    const initKonva = (Konva: any) => {
      const vw = container.clientWidth
      const vh = container.clientHeight
      if (vw === 0 || vh === 0) { setTimeout(() => initKonva(Konva), 50); return }

      const TW = 100
      const PW = TW * cols
      const PH = TW * rows

      const stage = new Konva.Stage({ container, width: vw, height: vh })
      stageInstance = stage

      const woodLayer  = new Konva.Layer({ listening: false })
      const matLayer   = new Konva.Layer({ listening: false })
      const pieceLayer = new Konva.Layer()
      stage.add(woodLayer, matLayer, pieceLayer)

      //  View state 
      const showW = PW + 200, showH = PH + 200
      const initScale = Math.min(vw / showW, vh / showH) * 0.9
      const view = {
        x: vw/2 - WORLD_CX * initScale,
        y: vh/2 - WORLD_CY * initScale,
        scale: initScale
      }
      const applyView = () => {
        [woodLayer, matLayer, pieceLayer].forEach(l => {
          l.x(view.x); l.y(view.y); l.scaleX(view.scale); l.scaleY(view.scale)
        })
        stage.batchDraw()
      }
      applyView()

      //  Wood 
      const woodImg = new window.Image()
      woodImg.onload = () => {
        woodLayer.add(new Konva.Image({ x:0, y:0, width:WORLD_W, height:WORLD_H, image:woodImg, listening:false }))
        woodLayer.batchDraw()
      }
      woodImg.src = woodSrc

      //  Mat 
      const mx = WORLD_CX - PW/2, my = WORLD_CY - PH/2, mp = 14
      matLayer.add(new Konva.Rect({ x:mx-mp+7, y:my-mp+9, width:PW+mp*2, height:PH+mp*2, fill:'rgba(0,0,0,0.5)', listening:false }))
      matLayer.add(new Konva.Rect({ x:mx-mp, y:my-mp, width:PW+mp*2, height:PH+mp*2, fill:'#0D0C10', listening:false }))
      matLayer.add(new Konva.Rect({ x:mx-8, y:my-8, width:PW+16, height:PH+16, fill:'transparent', stroke:'rgba(90,88,100,0.8)', strokeWidth:1.2, dash:[4,3], listening:false }))
      matLayer.add(new Konva.Rect({ x:mx-mp, y:my-mp, width:PW+mp*2, height:PH+mp*2, fill:'transparent', stroke:'rgba(255,255,255,0.05)', strokeWidth:1, listening:false }))
      matLayer.batchDraw()

      //  Offscreen puzzle image 
      const off = document.createElement('canvas')
      off.width = PW; off.height = PH
      off.getContext('2d')!.drawImage(image, 0, 0, PW, PH)

      //  Piece state 
      const pattern = buildTabPattern(cols, rows)
      interface P { id:string; gx:number; gy:number; x:number; y:number; gid:string; zIdx:number; path:string }
      const pieces = new Map<string, P>()
      const groups = new Map<string, string[]>()  // gid -> piece ids
      const kGroups = new Map<string, any>()       // id -> Konva.Group
      let topZ = 1
      const pad = 25, spread = 70

      for (let gy = 0; gy < rows; gy++) {
        for (let gx = 0; gx < cols; gx++) {
          const id = `${gx}_${gy}`
          const hw = PW/2, hh = PH/2
          let px = WORLD_CX, py = WORLD_CY
          for (let a = 0; a < 30; a++) {
            const s = Math.floor(Math.random()*4)
            if      (s===0) { px=WORLD_CX-hw-pad-Math.random()*spread; py=WORLD_CY+(Math.random()-.5)*(hh*2+pad*2) }
            else if (s===1) { px=WORLD_CX+hw+pad+Math.random()*spread; py=WORLD_CY+(Math.random()-.5)*(hh*2+pad*2) }
            else if (s===2) { px=WORLD_CX+(Math.random()-.5)*(hw*2+pad*2); py=WORLD_CY-hh-pad-Math.random()*spread }
            else             { px=WORLD_CX+(Math.random()-.5)*(hw*2+pad*2); py=WORLD_CY+hh+pad+Math.random()*spread }
            if (Math.abs(px-WORLD_CX)>hw+5 || Math.abs(py-WORLD_CY)>hh+5) break
          }
          const path = buildPath(gx, gy, cols, rows, pattern, TW)
          pieces.set(id, { id, gx, gy, x:px, y:py, gid:id, zIdx:0, path })
          groups.set(id, [id])
        }
      }

      //  Draw piece 
      const makePiece = (p: P) => {
        const old = kGroups.get(p.id); if (old) old.destroy()

        // Clip group  piece shape is the clip
        const clipGrp = new Konva.Group({
          x: p.x - TW/2, y: p.y - TW/2,
          clipFunc: (ctx2: any) => {
            const path = new Path2D(p.path)
            ctx2.clip(path)
          }
        })

        // Cropped image inside clip
        clipGrp.add(new Konva.Image({
          x: 0, y: 0,
          image: off,
          cropX: p.gx * TW, cropY: p.gy * TW,
          cropWidth: TW, cropHeight: TW,
          width: TW, height: TW,
          listening: false,
        }))

        // Outer group holds shadow + clip group
        const outerGrp = new Konva.Group({ x: 0, y: 0 })
        outerGrp.add(new Konva.Path({ data: p.path, fill: 'rgba(0,0,0,0.35)', x: p.x-TW/2+3, y: p.y-TW/2+4, listening: false }))
        outerGrp.add(clipGrp)
        outerGrp.add(new Konva.Path({ data: p.path, stroke: 'rgba(255,255,255,0.22)', strokeWidth: 1, fill: 'transparent', x: p.x-TW/2, y: p.y-TW/2, listening: false }))

        pieceLayer.add(outerGrp)
        kGroups.set(p.id, outerGrp)
        return outerGrp
      }

      Array.from(pieces.values()).forEach(p => makePiece(p))
      pieceLayer.batchDraw()

      //  Snap group to anchor 
      const snapGroup = (anchorId: string) => {
        const anchor = pieces.get(anchorId)!
        const grp = groups.get(anchor.gid)!
        grp.forEach(pid => {
          const pm = pieces.get(pid)!
          pm.x = anchor.x + (pm.gx - anchor.gx) * TW
          pm.y = anchor.y + (pm.gy - anchor.gy) * TW
          const kg = kGroups.get(pid)
          if (!kg) return
          // Update all child positions
          const children = kg.getChildren()
          // shadow
          children[0].x(pm.x - TW/2 + 3); children[0].y(pm.y - TW/2 + 4)
          // clip group
          children[1].x(pm.x - TW/2); children[1].y(pm.y - TW/2)
          // outline
          children[2].x(pm.x - TW/2); children[2].y(pm.y - TW/2)
        })
      }

      //  Connect pieces 
      const tryConnect = (movedId: string) => {
        const moved = pieces.get(movedId)!
        const thresh = TW / 6
        let merged = false

        // Snapshot current group members  do NOT mutate while iterating
        const snapshot = groups.get(moved.gid)!.slice()
        // Collect neighbor gids to merge (deduplicated)
        const toMerge: string[] = []

        snapshot.forEach(pid => {
          const p = pieces.get(pid)!
          ;([[1,0],[-1,0],[0,1],[0,-1]] as [number,number][]).forEach(([dx,dy]) => {
            const nbId = `${p.gx+dx}_${p.gy+dy}`
            const nb = pieces.get(nbId)
            if (!nb || nb.gid === moved.gid) return
            if (toMerge.includes(nb.gid)) return  // already queued
            const expX = p.x + dx*TW, expY = p.y + dy*TW
            if (Math.abs(expX - nb.x) + Math.abs(expY - nb.y) < thresh) {
              toMerge.push(nb.gid)
            }
          })
        })

        // Apply all merges after iteration is complete
        toMerge.forEach(nbGid => {
          const nbPieces = groups.get(nbGid)
          if (!nbPieces) return  // already merged in this pass
          const myGrp = groups.get(moved.gid)!
          nbPieces.forEach(nid => {
            pieces.get(nid)!.gid = moved.gid
            myGrp.push(nid)
          })
          groups.delete(nbGid)
          merged = true
        })

        if (merged) {
          snapGroup(movedId)
          pieceLayer.batchDraw()
          if (groups.size === 1) onComplete()
        }
      }

      //  Move piece group 
      const moveGroup = (id: string, dx: number, dy: number) => {
        const p = pieces.get(id)!
        const grp = groups.get(p.gid)!
        grp.forEach(pid => {
          const pm = pieces.get(pid)!
          pm.x += dx; pm.y += dy
          const kg = kGroups.get(pid)
          if (!kg) return
          const ch = kg.getChildren()
          ch[0].x(pm.x - TW/2 + 3); ch[0].y(pm.y - TW/2 + 4)
          ch[1].x(pm.x - TW/2);     ch[1].y(pm.y - TW/2)
          ch[2].x(pm.x - TW/2);     ch[2].y(pm.y - TW/2)
        })
        pieceLayer.batchDraw()
      }

      const bringGroupToTop = (id: string) => {
        topZ++
        const p = pieces.get(id)!
        const grp = groups.get(p.gid)!
        grp.forEach(pid => {
          pieces.get(pid)!.zIdx = topZ
          kGroups.get(pid)?.moveToTop()
        })
      }

      //  Hit test 
      const hitTest = (wx: number, wy: number): string | null => {
        let best: string | null = null, bestZ = -1
        Array.from(pieces.values()).forEach(p => {
          const lx = wx - (p.x - TW/2), ly = wy - (p.y - TW/2)
          if (lx > -15 && lx < TW+15 && ly > -15 && ly < TW+15 && p.zIdx >= bestZ) {
            best = p.id; bestZ = p.zIdx
          }
        })
        return best
      }

      const toWorld = (cx: number, cy: number) => ({
        x: (cx - view.x) / view.scale,
        y: (cy - view.y) / view.scale,
      })

      //  Pointer state 
      let drag: { id: string; startWx: number; startWy: number } | null = null
      let pan:  { startCx: number; startCy: number; vx: number; vy: number } | null = null
      let pinch: { dist: number; cx: number; cy: number } | null = null

      //  Mouse 
      stage.on('mousedown', (e: any) => {
        const pos = stage.getPointerPosition(); if (!pos) return
        const w = toWorld(pos.x, pos.y)
        const hit = hitTest(w.x, w.y)
        if (hit) {
          bringGroupToTop(hit)
          const p = pieces.get(hit)!
          drag = { id: hit, startWx: w.x, startWy: w.y }
        } else {
          pan = { startCx: pos.x, startCy: pos.y, vx: view.x, vy: view.y }
        }
      })
      stage.on('mousemove', () => {
        const pos = stage.getPointerPosition(); if (!pos) return
        if (drag) {
          const w = toWorld(pos.x, pos.y)
          moveGroup(drag.id, w.x - drag.startWx, w.y - drag.startWy)
          drag.startWx = w.x; drag.startWy = w.y
        } else if (pan) {
          view.x = pan.vx + pos.x - pan.startCx
          view.y = pan.vy + pos.y - pan.startCy
          applyView()
        }
      })
      stage.on('mouseup', () => {
        if (drag) { tryConnect(drag.id); drag = null }
        pan = null
      })

      //  Touch 
      const el = container
      el.addEventListener('touchstart', (e: TouchEvent) => {
        e.preventDefault()
        if (e.touches.length === 1) {
          const t = e.touches[0]
          const r = el.getBoundingClientRect()
          const w = toWorld(t.clientX - r.left, t.clientY - r.top)
          const hit = hitTest(w.x, w.y)
          if (hit) {
            bringGroupToTop(hit)
            const p = pieces.get(hit)!
            drag = { id: hit, startWx: w.x, startWy: w.y }
          } else {
            pan = { startCx: t.clientX, startCy: t.clientY, vx: view.x, vy: view.y }
          }
          pinch = null
        } else if (e.touches.length === 2) {
          drag = null; pan = null
          const t0 = e.touches[0], t1 = e.touches[1]
          const r = el.getBoundingClientRect()
          pinch = {
            dist: Math.hypot(t1.clientX-t0.clientX, t1.clientY-t0.clientY),
            cx: (t0.clientX+t1.clientX)/2 - r.left,
            cy: (t0.clientY+t1.clientY)/2 - r.top,
          }
        }
      }, { passive: false })

      el.addEventListener('touchmove', (e: TouchEvent) => {
        e.preventDefault()
        const r = el.getBoundingClientRect()
        if (e.touches.length === 1 && !pinch) {
          const t = e.touches[0]
          const w = toWorld(t.clientX - r.left, t.clientY - r.top)
          if (drag) {
            moveGroup(drag.id, w.x - drag.startWx, w.y - drag.startWy)
            drag.startWx = w.x; drag.startWy = w.y
          } else if (pan) {
            view.x = pan.vx + t.clientX - pan.startCx
            view.y = pan.vy + t.clientY - pan.startCy
            applyView()
          }
        } else if (e.touches.length === 2 && pinch) {
          const t0 = e.touches[0], t1 = e.touches[1]
          const dist = Math.hypot(t1.clientX-t0.clientX, t1.clientY-t0.clientY)
          const cx = (t0.clientX+t1.clientX)/2 - r.left
          const cy = (t0.clientY+t1.clientY)/2 - r.top
          const f = dist / pinch.dist
          view.x = cx - (cx - view.x) * f + (cx - pinch.cx)
          view.y = cy - (cy - view.y) * f + (cy - pinch.cy)
          view.scale *= f
          pinch = { dist, cx, cy }
          applyView()
        }
      }, { passive: false })

      el.addEventListener('touchend', (e: TouchEvent) => {
        if (e.touches.length === 0) {
          if (drag) { tryConnect(drag.id); drag = null }
          pan = null; pinch = null
        } else if (e.touches.length < 2) {
          pinch = null
        }
      }, { passive: false })

      el.addEventListener('wheel', (e: WheelEvent) => {
        e.preventDefault()
        const r = el.getBoundingClientRect()
        const cx = e.clientX - r.left, cy = e.clientY - r.top
        const f = e.deltaY > 0 ? 0.9 : 1.1
        view.x = cx - (cx - view.x) * f
        view.y = cy - (cy - view.y) * f
        view.scale *= f
        applyView()
      }, { passive: false })

      //  Expose actions 
      actionsRef.current = {
        scatter: () => {
          // Break all groups back to singletons
          groups.clear()
          Array.from(pieces.values()).forEach(p => { p.gid = p.id; groups.set(p.id, [p.id]) })
          const hw = PW/2, hh = PH/2
          Array.from(pieces.values()).forEach(p => {
            for (let a = 0; a < 30; a++) {
              const s = Math.floor(Math.random()*4)
              if      (s===0) { p.x=WORLD_CX-hw-pad-Math.random()*spread; p.y=WORLD_CY+(Math.random()-.5)*(hh*2+pad*2) }
              else if (s===1) { p.x=WORLD_CX+hw+pad+Math.random()*spread; p.y=WORLD_CY+(Math.random()-.5)*(hh*2+pad*2) }
              else if (s===2) { p.x=WORLD_CX+(Math.random()-.5)*(hw*2+pad*2); p.y=WORLD_CY-hh-pad-Math.random()*spread }
              else             { p.x=WORLD_CX+(Math.random()-.5)*(hw*2+pad*2); p.y=WORLD_CY+hh+pad+Math.random()*spread }
              if (Math.abs(p.x-WORLD_CX)>hw+5||Math.abs(p.y-WORLD_CY)>hh+5) break
            }
            const kg = kGroups.get(p.id)
            if (kg) { const ch=kg.getChildren(); ch[0].x(p.x-TW/2+3);ch[0].y(p.y-TW/2+4);ch[1].x(p.x-TW/2);ch[1].y(p.y-TW/2);ch[2].x(p.x-TW/2);ch[2].y(p.y-TW/2) }
          })
          pieceLayer.batchDraw()
        },
        fit: () => {
          view.x = vw/2 - WORLD_CX*initScale
          view.y = vh/2 - WORLD_CY*initScale
          view.scale = initScale
          applyView()
        },
        zoom: (f: number) => {
          const cx = vw/2, cy = vh/2
          view.x = cx-(cx-view.x)*f; view.y = cy-(cy-view.y)*f; view.scale*=f
          applyView()
        }
      }
    }

    if ((window as any).Konva) {
      initKonva((window as any).Konva)
    } else {
      const s = document.createElement('script')
      s.src = 'https://cdnjs.cloudflare.com/ajax/libs/konva/9.3.6/konva.min.js'
      s.onload = () => initKonva((window as any).Konva)
      s.onerror = () => console.error('Konva CDN failed')
      document.head.appendChild(s)
    }

    return () => { try { stageInstance?.destroy() } catch(_) {} }
  }, [image, cols, rows])

  return <div ref={divRef} style={{ width:'100%', height:'100%' }} />
}

//  Main page 
export default function JigsawPage() {
  const [image,       setImage]       = useState<HTMLImageElement | null>(null)
  const [imageSrc,    setImageSrc]    = useState('')
  const [numCols,     setNumCols]     = useState(4)
  const [numRows,     setNumRows]     = useState(3)
  const [complete,    setComplete]    = useState(false)
  const [showPreview, setShowPreview] = useState(false)
  const [showDiff,    setShowDiff]    = useState(false)
  const actionsRef = useRef<{ scatter:()=>void; fit:()=>void; zoom:(f:number)=>void } | null>(null)

  const toolBtn: React.CSSProperties = {
    width:40, height:40, borderRadius:10, padding:0,
    background:'rgba(168,85,247,0.15)', border:'1px solid rgba(168,85,247,0.4)',
    color:'#c084fc', display:'flex', alignItems:'center', justifyContent:'center',
    cursor:'pointer', flexShrink:0,
  }

  const loadSample = (url: string) => {
    const img = new Image(); img.crossOrigin = 'anonymous'
    img.onload = () => { setComplete(false); setImageSrc(url); setImage(img) }
    img.src = url
  }
  const handleUpload = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0]; if (!file) return
    const url = URL.createObjectURL(file)
    const img = new Image()
    img.onload = () => { setComplete(false); setImageSrc(url); setImage(img) }
    img.src = url
  }

  return (
    <>
      {!image && (
        <div style={{ minHeight:'100vh', background:'linear-gradient(135deg,#1a1423,#2d1b3d,#1a1423)', padding:'40px 20px', fontFamily:'ui-sans-serif,system-ui,sans-serif' }}>
          <div style={{ maxWidth:480, margin:'0 auto' }}>
            <div style={{ display:'flex', alignItems:'center', justifyContent:'space-between', marginBottom:4 }}>
              <a href="/amhgames" style={{ display:'flex', alignItems:'center', gap:6, color:'#a78bfa', textDecoration:'none', fontSize:13, padding:'6px 10px', borderRadius:8, border:'1px solid rgba(168,85,247,0.3)', background:'rgba(168,85,247,0.08)' }}><Home size={14}/> Home</a>
              <h1 style={{ fontSize:32, fontWeight:900, color:'#c084fc', letterSpacing:'0.12em', margin:0 }}>JIGSAW</h1>
              <div style={{ width:80 }}/>
            </div>
            <p style={{ textAlign:'center', color:'#a78bfa', fontSize:12, marginBottom:28, textTransform:'uppercase', letterSpacing:'0.1em' }}>Pick an image to start</p>
            <label style={{ display:'block', padding:'30px 20px', borderRadius:16, border:'2px dashed rgba(168,85,247,0.4)', background:'rgba(168,85,247,0.05)', cursor:'pointer', textAlign:'center', marginBottom:18 }}>
              <input type="file" accept="image/*" onChange={handleUpload} style={{ display:'none' }}/>
              <Upload size={36} style={{ color:'#a855f7', margin:'0 auto 10px', display:'block' }}/>
              <p style={{ color:'#e9d5ff', fontWeight:600, marginBottom:4 }}>Upload your own image</p>
              <p style={{ color:'#9ca3af', fontSize:12 }}>Tap to select a photo</p>
            </label>
            <p style={{ color:'#a78bfa', fontSize:12, textAlign:'center', marginBottom:10 }}>Or pick a sample:</p>
            <div style={{ display:'grid', gridTemplateColumns:'1fr 1fr', gap:10, marginBottom:18 }}>
              {SAMPLE_IMAGES.map((s,i) => (
                <button key={i} onClick={() => loadSample(s.url)} style={{ position:'relative', aspectRatio:'16/10', borderRadius:10, overflow:'hidden', border:'2px solid rgba(168,85,247,0.3)', cursor:'pointer', padding:0, background:'none' }}>
                  <img src={s.url} alt={s.name} style={{ width:'100%', height:'100%', objectFit:'cover', display:'block' }}/>
                  <div style={{ position:'absolute', bottom:0, left:0, right:0, padding:'3px 8px', background:'rgba(0,0,0,0.65)', color:'#fff', fontSize:11, textAlign:'center' }}>{s.name}</div>
                </button>
              ))}
            </div>
            <div style={{ padding:'14px 16px', borderRadius:12, background:'rgba(168,85,247,0.07)', border:'1px solid rgba(168,85,247,0.22)' }}>
              <p style={{ color:'#a78bfa', fontSize:12, marginBottom:10 }}>Difficulty</p>
              <div style={{ display:'grid', gridTemplateColumns:'repeat(4,1fr)', gap:8 }}>
                {DIFFICULTIES.map(d => (
                  <button key={d.label} onClick={() => { setNumCols(d.cols); setNumRows(d.rows) }}
                    style={{ padding:'8px 4px', borderRadius:8, border:`1px solid ${numCols===d.cols?'rgba(168,85,247,0.8)':'rgba(168,85,247,0.25)'}`, background:numCols===d.cols?'rgba(168,85,247,0.3)':'transparent', color:'#e9d5ff', fontSize:12, cursor:'pointer', fontWeight:numCols===d.cols?700:400 }}>
                    {d.label}<br/><span style={{ fontSize:10, opacity:.6 }}>{d.cols*d.rows}pc</span>
                  </button>
                ))}
              </div>
            </div>
          </div>
        </div>
      )}

      {image && (
        <div style={{ display:'flex', flexDirection:'column', height:'100dvh', background:'#0e0917', fontFamily:'ui-sans-serif,system-ui,sans-serif', overflow:'hidden', position:'fixed', inset:0 }}>
          <div style={{ display:'none', position:'fixed', inset:0, zIndex:100, background:'#0e0917', alignItems:'center', justifyContent:'center', flexDirection:'column', gap:16 }} className="portrait-overlay">
            <div style={{ fontSize:48 }}></div>
            <p style={{ color:'#c084fc', fontWeight:700, fontSize:18, margin:0 }}>Rotate to landscape</p>
          </div>
          <style>{`@media (orientation:portrait){.portrait-overlay{display:flex!important}}`}</style>

          <div style={{ flexShrink:0, height:46, background:'rgba(14,9,23,0.97)', borderBottom:'1px solid rgba(168,85,247,0.4)', display:'flex', alignItems:'center', justifyContent:'space-between', padding:'0 14px', zIndex:30 }}>
            <span style={{ fontSize:16, fontWeight:900, color:'#c084fc', letterSpacing:'0.12em' }}>JIGSAW</span>
            <span style={{ fontSize:11, color:'#a78bfa' }}>{numCols}{numRows}  {numCols*numRows}pc</span>
            <button onClick={() => { setImage(null); setComplete(false) }} style={{ ...toolBtn, width:'auto', padding:'0 12px', fontSize:12, height:34 }}>New Game</button>
          </div>

          <div style={{ flex:1, overflow:'hidden', position:'relative' }}>
            <JigsawCanvas
              key={`${imageSrc}-${numCols}-${numRows}`}
              image={image} cols={numCols} rows={numRows}
              woodSrc={WOOD_DATA}
              actionsRef={actionsRef}
              onComplete={() => setComplete(true)}
            />
          </div>

          <div style={{ flexShrink:0, height:60, background:'rgba(14,9,23,0.97)', borderTop:'1px solid rgba(168,85,247,0.4)', display:'flex', alignItems:'center', justifyContent:'center', gap:8, padding:'0 10px', zIndex:30 }}>
            <a href="/amhgames" style={{ ...toolBtn, textDecoration:'none', display:'flex', alignItems:'center', justifyContent:'center' }}><Home size={18}/></a>
            <div style={{ width:1, height:24, background:'rgba(168,85,247,0.3)' }}/>
            <button style={toolBtn} onClick={() => actionsRef.current?.scatter()}><Sparkles size={18}/></button>
            <button style={toolBtn} onClick={() => setShowPreview(true)}><Eye size={18}/></button>
            <div style={{ width:1, height:24, background:'rgba(168,85,247,0.3)' }}/>
            <div style={{ position:'relative' }}>
              <button style={toolBtn} onClick={() => setShowDiff(d=>!d)}><Grid3X3 size={18}/></button>
              {showDiff && (
                <div style={{ position:'absolute', bottom:48, left:'50%', transform:'translateX(-50%)', background:'rgba(14,9,23,0.98)', border:'1px solid rgba(168,85,247,0.5)', borderRadius:12, padding:8, display:'flex', flexDirection:'column', gap:3, minWidth:130, zIndex:50 }}>
                  {DIFFICULTIES.map(d => (
                    <button key={d.label} onClick={() => { setNumCols(d.cols); setNumRows(d.rows); setShowDiff(false); setComplete(false) }}
                      style={{ padding:'8px 12px', borderRadius:8, border:'none', background:numCols===d.cols?'rgba(168,85,247,0.35)':'transparent', color:'#e9d5ff', fontSize:13, cursor:'pointer', textAlign:'left', fontWeight:numCols===d.cols?700:400 }}>
                      {d.label} <span style={{ opacity:.55, fontSize:11 }}>({d.cols*d.rows}pc)</span>
                    </button>
                  ))}
                </div>
              )}
            </div>
            <button style={toolBtn} onClick={() => actionsRef.current?.fit()}><Maximize2 size={16}/></button>
            <div style={{ width:1, height:24, background:'rgba(168,85,247,0.3)' }}/>
            <button style={toolBtn} onClick={() => actionsRef.current?.zoom(0.85)}><Minus size={18}/></button>
            <button style={toolBtn} onClick={() => actionsRef.current?.zoom(1.18)}><Plus size={18}/></button>
          </div>

          <AnimatePresence>
            {showPreview && (
              <motion.div initial={{opacity:0}} animate={{opacity:1}} exit={{opacity:0}} onClick={()=>setShowPreview(false)}
                style={{ position:'fixed',inset:0,background:'rgba(0,0,0,0.82)',zIndex:60,display:'flex',alignItems:'center',justifyContent:'center',padding:20 }}>
                <motion.div initial={{scale:.9}} animate={{scale:1}} exit={{scale:.9}} onClick={e=>e.stopPropagation()}
                  style={{ background:'rgba(14,9,23,0.98)',borderRadius:16,border:'1px solid rgba(168,85,247,0.5)',padding:12,maxWidth:360,width:'100%' }}>
                  <div style={{ display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:10 }}>
                    <span style={{ color:'#c084fc',fontWeight:700,fontSize:14 }}>Reference</span>
                    <button onClick={()=>setShowPreview(false)} style={{...toolBtn,width:28,height:28}}><X size={14}/></button>
                  </div>
                  <img src={imageSrc} alt="ref" style={{ width:'100%',borderRadius:10,display:'block' }}/>
                </motion.div>
              </motion.div>
            )}
          </AnimatePresence>

          <AnimatePresence>
            {complete && (
              <motion.div initial={{opacity:0}} animate={{opacity:1}}
                style={{ position:'fixed',inset:0,background:'rgba(0,0,0,0.78)',zIndex:60,display:'flex',alignItems:'center',justifyContent:'center' }}>
                <motion.div initial={{scale:.85,y:20}} animate={{scale:1,y:0}}
                  style={{ background:'rgba(14,9,23,0.98)',borderRadius:20,border:'2px solid rgba(168,85,247,0.6)',padding:32,textAlign:'center',maxWidth:300,width:'90%' }}>
                  <CheckCircle size={52} style={{ color:'#a855f7',margin:'0 auto 12px',display:'block' }}/>
                  <p style={{ color:'#fff',fontSize:22,fontWeight:800,marginBottom:6 }}>Puzzle Complete!</p>
                  <p style={{ color:'#a78bfa',fontSize:13,marginBottom:24 }}>All {numCols*numRows} pieces connected</p>
                  <div style={{ display:'flex',gap:10 }}>
                    <button onClick={()=>setComplete(false)} style={{ flex:1,padding:'12px 0',borderRadius:10,border:'1px solid rgba(168,85,247,0.5)',background:'rgba(168,85,247,0.2)',color:'#e9d5ff',fontWeight:700,cursor:'pointer',fontSize:14 }}>Play Again</button>
                    <button onClick={()=>{setImage(null);setComplete(false)}} style={{ flex:1,padding:'12px 0',borderRadius:10,border:'1px solid rgba(168,85,247,0.7)',background:'rgba(168,85,247,0.4)',color:'#fff',fontWeight:700,cursor:'pointer',fontSize:14 }}>New Game</button>
                  </div>
                </motion.div>
              </motion.div>
            )}
          </AnimatePresence>
        </div>
      )}
    </>
  )
}
